import React from "react";

function FriendCard(props) {
  return (
    <>
      {props.friends.map(item => (
        <div className="card" key={item.id}>
          <div className="img-container">
            <img alt={item.name} src={item.image} />
          </div>
        </div>
      ))}
    </>
  );
}

export default FriendCard;
